INSERT INTO `table_baiviet` (`id`, `id_cat`, `id_list`, `id_item`, `id_sub`, `type`, `noibat`, `banchay`, `photo`, `thumb`, `ten_vi`, `masp`, `tenkhongdau`, `khuyenmai_vi`, `khuyenmai_en`, `thongtin_vi`, `thongtin_en`, `baohanh_vi`, `baohanh_en`, `title`, `keywords`, `description`, `des_char`, `is_noindex`, `giaban`, `giacu`, `mota_vi`, `noidung_vi`, `name_vi`, `name_en`, `ten_en`, `mota_en`, `noidung_en`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `luotxem`) VALUES
(1, 2, 2, 4, 0, 'baiviet', 1, 1, 'clqzek201402x464-7928.png', 'clqzek201402x464-7928_173.275862069x200.png', 'Vng eo tay bng cao su', 'MA_0094', 'vong-deo-tay-bang-cao-su', '', '', '', '', '', '', 'Vng eo tay bng cao su', 'Vng eo tay bng cao su', 'Vng eo tay bng cao su', 0, 0, 400000, 500000, 'Nga cng b video cho thy my bay nc ny khng kch s ch huy, kho xng du v cng s ca Nh nc Hi gio (IS)  Syria', '<p class="Normal">My bay Nga sng qua thc hin 22 ln xut kch, ph hy 27 c s IS  Syria, <em>Sputnik</em> dn li pht ngn vin B Ngoi giao Nga Igor Konashenkov, ni trong mt cuc hp bo  Moscow.</p>\r\n\r\n<p class="Normal">ng cho bit c th rng my bay Nga tin hnh cc t khng kch vo 11 tri hun luyn IS  tnh Hama v Raqqa. Ngoi ra, my bay Su-25 v Su-34 tn cng 8 a im ca phin qun  tnh Homs. M<span>y bay Nga  s dng bom ph b tng  ph hy cng s ngm ca IS ti ty bc Syria.</span></p>\r\n\r\n<p class="Normal"><span>on video cho thy cc cuc khng kch ca Nga nhm vo mt s ch huy IS v cng s gn lng Tamana  Hama, ng Konashenkov cho bit.</span></p>\r\n\r\n<div style="text-align:center;">\r\n<div class="embed-container"></div>\r\n</div>\r\n\r\n<p class="Normal">Nga bt u chin dch khng kch ti Syria t ngy 30/9 theo  ngh t Tng thng Syria Bashar al-Assad. Moscow tuyn b nhm vo IS nhng Washington cng ng minh lo ngi Nga can thip qun s  cng c chnh quyn al-Assad.</p>\r\n\r\n<table align="center" border="0" cellpadding="3" cellspacing="0" class="tplCaption" style="width: 100%;">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="may-bay-nga-pha-huy-27-co-so-is-tai-syria" data-natural-width="500" data-pwidth="470.4" data-width="500" src="http://m.f29.img.vnecdn.net/2015/10/09/syria-3-5-13-2-8196-1444347740.jpg" style="width: 100%;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p class="Image">V tr cc tnh  Syria.  ha: <em>Stratfor</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '', '', '', '', '', 1, 1, 1444355781, 1446520051, 0),
(37, 0, 0, 0, 0, 'gioithieu', 1, 0, 'mychau-532.jpg', 'mychau-532_230x190.jpg', 'V chng ti', '', 've-chung-toi', '', '', '', '', '', '', 'V Chng Ti', 'GIA DNG MY CHU', ' gia dng,  dng nh bp, in gia dng, thy tinh, ni inox, cho chng dnh, xay sinh to, bn i, x nha, thau nha, chn, da, camen, snh s, bp ga mini,  dng sinh hot', 0, 0, 0, 0, 'V chng ti', '<p style="text-align: center;"><span style="font-size:18px;"><span style="color:#FF0000;"><strong>" Uy Tn Trong Bun Bn - Trung Thc Trong T Vn "</strong></span></span></p>\r\n\r\n<p style="text-align: center;"><span style="font-size:14px;">*** Chng ti chuyn cung cp cc mt hng  gia dng trong gia nh. Cc sn phm phc v nh bp, v sinh nh ca, vt dng cho qun n, qun cafe, trang tr nh ca ***<br />\r\n- Ngoi ra Shop cn nhn giao hng trc tip n cc qun ni thnh i vi nhng sn phm d v nh thy tinh hoc snh s vi ph vn chuyn u i, nh vy khch hng c th yn tm hn i vi sn phm t mua khng b b hoc h v khi nhn hng. Qu khch c th ch ng lin h vi shop qua Zalo hoc Viber  c t vn hp l nht.</span></p>\r\n', '', '', '', '', '', 1, 1, 1452071129, 1458725187, 0),
