kin quan st tin r hn, mu m p chuyn dng trong cc ngn hng ph hp cho s dng ti vn phng cng ty c khng gian rng.<br />\r\n</p>\r\n', '', '', '', '', '', 1, 1, 1444795510, 1446519874, 0),
