(11, 4, 5, 6, 0, 'baiviet', 1, 0, 'thuysi-1443.jpg', 'thuysi-1443_260x195.jpg', 'Hi tho: Du hc Thy S - m bo thc tp hng lng cao ', 'MA_0094', 'hoi-thao-du-hoc-thuy-si-dam-bao-thuc-tap-huong-luong-cao', '', '', '', '', '12 Thng', '', 'Sinh vin v qu ph huynh c c hi nhn nhng mn qu xinh xn', 'Sinh vin v qu ph huynh c c hi nhn nhng mn qu xinh xn', 'Khi n vi Hi tho, Sinh vin v qu ph huynh c c hi nhn nhng mn qu xinh xn, hp dn; c t vn min ph theo nhu cu. Ngoi ra, nhng sinh vin  iu kin Visa du hc s c min ph Visa v c nhn hc bng 2000CHF.', 0, 0, 1500000, 2000000, 'Khi n vi Hi tho, Sinh vin v qu ph huynh c c hi nhn nhng mn qu xinh xn, hp dn; c t vn min ph theo nhu cu. Ngoi ra, nhng sinh vin  iu kin Visa du hc s c min ph Visa v c nhn hc bng 2000CHF.', '<h2 style="text-align: justify;">1. iu g khin chng trnh o to ngnh<a href="http://megastudy.edu.vn/du-hoc-thuy-si/nganh-du-lich-khach-san-ra-truong-la-co-viec-lam-a491.html">Qun tr Khch sn  Du lch</a>ti Thy S li hp dn sinh vin nh vy?</h2>\r\n\r\n<p style="text-align: justify;">Thy S  Nn vn ha Chu u thu nh v nn gio dc hin i</p>\r\n\r\n<p style="text-align: justify;">Nn gio dc ca Thy S: Chnh ph Thy S dnh rt nhiu u i cho gio dc v coi  l mt trong nhng quc sch hng u  thc y nn kinh t pht trin. Thy S cng dnh mt phn ln ngn sch  trao hc bng v to iu kin cho nhng sinh vin khi du hc ti nc ny</p>\r\n\r\n<p style="text-align: justify;">S chuyn nghip:T trang phc, cch i ng, ni nng ca cc sinh vin hc ti <a href="http://megastudy.edu.vn/du-hoc-thuy-si-n11.html">Thy S</a> u tot ln s chuyn nghip v ng cp. iu  cng d l gii khi sinh vin c hc v thc tp ti mt t nc vn minh v mi trng Chu u. Sinh vin c hc nhng k nng cn c ca nh qun l trong lnh vc Du lch, m thc, Nh hng khch sn. Nhng k nng ny u st vi thc t v sn sng ng dng vo thc t cng vic.</p>\r\n\r\n<p style="text-align: justify;">Sau khi tt nghip, sinh vin d dng lm tt cng vic  chuyn ngnh mnh  hc m khng b b ng, thiu k nng nh tnh trng v sinh vin Vit Nam vn thng gp phi.</p>\r\n\r\n<p style="text-align: justify;">Qun tr Kinh doanh Du lch-Khch sn l th mnh ca nn gio dc Thy S: Hu ht cc khch sn ln trn th gi u c qun l v iu hnh bi nhng nh qun l tt nghip  Thy S. Th mnh ny chnh l s kt hp linh hot gia l thuyt, thc hnh v cc k thc tp ti cc nh hng, khch sn ln cng trang thit b, gio trnh v phng php ging dy tin tin, hin i. Theo thng l, hng nm sinh vin ch hc tp ti trng t 5 n 6 thng, thi gian cn li s i thc tp v c bit sinh vin c hng lng khong 10.500-11.000 USD trong cc k thc tp ny. iu ny cho php sinh vin lm quen vi mi trng cng vic v tch lu kinh nghim, chnh v th m rt nhiu sinh vin c cc cng ty, nh hng, khch sn ni ting nhn lm vic ngay khi cha tt nghip i hc. iu  m ra cho sinh vin mt tng lai c th lm vic ti cc nc M, c sau khi ra trng. Vo nm hc cui cng, mt s cc trng c cc kho hc kt hp vi cc nc pht trin khc cp c 2 bng: bng ca Thy S v bng ca Anh, M</p>\r\n\r\n<p style="text-align: justify;"><img alt="" src="http://megastudy.edu.vn/upload/tinymce/441.jpg" style="display: block; margin-left: auto; margin-right: auto;" /></p>\r\n\r\n<p style="text-align: justify;">iu kin hc tp: Sinh vin cng c hc tp trong mt mi trng tin tin, tin nghi hin i nht. Sinh vin c cp bng quc t Qun l v kinh doanh Khch sn ngay sau khi ra trng.</p>\r\n\r\n<p style="text-align: justify;">-c bit trong thi gian hc i hc, sinh vin c tham gia thc tp ngay ti nhng khch sn ca trng. Thi gian thc tp l 6 thng/nm, sinh vin s c tr lng, sau khi tr tin n , sinh hot, sinh vin c th tit kim c 1000-1400 USD/thng.</p>\r\n\r\n<p style="text-align: justify;">Chi Ph: Chng trnh i Hc: 18.000  24.000 CHF/ nm</p>\r\n\r\n<p style="text-align: justify;">- Chng trnh Cao hc: 20.000-25.000 CHF/nm</p>\r\n\r\n<p style="text-align: justify;">- Chi ph khc: 3.000 CHF/nm (ng phc, bo him sc khe, ti liu hc, th sinh vin, sinh hot ngoi kha, ph an ninh)</p>\r\n\r\n<p style="text-align: justify;">Cc trng Qun tr du lch  khch sn Thy S lun c gng cho sinh vin c th p dng nhanh nht trong cng vic, thc tp l k bt buc ti cc trng. Ti ni thc tp cc bn sinh vin c tri qua cc cng vic khc nhau ca mi v tr, v c xy dng l trnh thng tin khi thc tp.</p>\r\n\r\n<p style="text-align: justify;">Lng thc tp trung bnh hng thng l: 2.500 CHF/ thng</p>\r\n\r\n<p style="text-align: justify;">Ngoi ra theo quy nh ca chnh ph Thy S, sinh vin c php lm thm 15h/tun, lng trung bnh 2025 CHF/gi. Nh vy sinh vin hon ton c th t ch chi ph ca mnh khi du hc ti Thy S.</p>\r\n\r\n<h2 style="text-align: justify;">2. Cc trng cht lng ti Thy S</h2>\r\n\r\n<p style="text-align: justify;">Thy S l ci ni ca nhng ngi trng cht lng nht o to v chuyn ngnh Qun tr Du lch-Khch sn. Sau y l mt s trng i Hc ni bt  sinh vin v ph huynh c th tham kho:</p>\r\n\r\n<p style="text-align: justify;"><a href="http://megastudy.edu.vn/du-hoc-thuy-si/swiss-imh-co-hoi-hoc-tap-voi-chi-phi-thap-nhat-tai-thuy-sy-a596.html">Trng Swiss IH&H</a></p>\r\n\r\n<p style="text-align: justify;"><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-truong-shml-a429.html"><span>Trng</span>SHML</a></p>\r\n\r\n<p style="text-align: justify;"><a href="http://megastudy.edu.vn/du-hoc-thuy-si/bhms-top-30-truong-quan-tri-du-lich-khach-san-tot-nhat-the-gioi-a481.html">Trng BHMS</a></p>\r\n\r\n<p style="text-align: justify;"><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-truong-shms-a433.html">Trng SHMS</a></p>\r\n\r\n<p style="text-align: justify;"><span><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-nganh-quan-tri-khach-san-tai-ihtti-a432.html">Trng IHTTI</a></span></p>\r\n\r\n<p style="text-align: justify;"><span><span><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-dai-hoc-neuchatel-a149.html">i hc Neuchatel</a></span></span></p>\r\n\r\n<p style="text-align: justify;"><span><span><span><span></span><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-dai-hoc-european-a416.html">i hc European</a></span></span></span></p>\r\n\r\n<p style="text-align: justify;"><span><span><span><span></span><span></span><a href="http://megastudy.edu.vn/du-hoc-thuy-si/hien-thuc-hoa-uoc-mo-nha-quan-ly-du-lich-khach-san-voi-hoc-bong-3000-chf-tu-htmi-a250.html">Trng HTMI</a></span></span></span></p>\r\n\r\n<p style="text-align: justify;">Ngoi ra, khi n vi Hi tho:<strong><span style="font-size: small; font-family: verdana, geneva;">DU HC THY S: VA HC VA LM-THC TP HNG LNG CAO,</span></strong><span style="font-family: verdana, geneva;">ph huynh v hc sinh s c t vn thm rt nhiu trng i hc  Thy S ni ting vi o to ngnh Qun tr Du lch-Khch sn nh:<strong><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-truong-shml-a429.html"> Trng i hc SHML</a></strong>, <strong><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-nganh-quan-tri-khach-san-tai-ihtti-a432.html">Trng i hc IHTTI</a></strong>, <strong><a href="http://megastudy.edu.vn/du-hoc-thuy-si/bhms-top-30-truong-quan-tri-du-lich-khach-san-tot-nhat-the-gioi-a481.html">Trng i hc BHMS</a></strong>, <strong><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-dai-hoc-european-a416.html">Trng i hc European</a></strong>, <strong><a href="http://megastudy.edu.vn/du-hoc-thuy-si/du-hoc-thuy-si-dai-hoc-neuchatel-a149.html">Trng i hc Neuchatel</a></strong>, <strong><a href="http://megastudy.edu.vn/du-hoc-thuy-si/nganh-du-lich-khach-san-ra-truong-la-co-viec-lam-a491.html">i hc HTMi</a></strong>...v rt nhiu ngi trng Thy S ang thu ht sinh vin trn ton Th gii.</span></p>\r\n\r\n<p style="text-align: justify;"> tm hiu r hn v Thy S, cc trng o to ngnh <strong><a href="http://megastudy.edu.vn/du-hoc-thuy-si/swiss-imh-co-hoi-hoc-tap-voi-chi-phi-thap-nhat-tai-thuy-sy-a596.html">Qun tr Du lch  Khch sn</a></strong>, c hi lm vic, thc tp hng lng hp dn, Megastudy xin trn trng knh mi Qu ph huynh, cc em hc sinh tham d hi tho:DU HC THY S: VA HC VA LM-THC TP HNG LNG CAO</p>\r\n\r\n<p style="text-align: justify;"><span>Ti Hi tho, Qu ph huynh v cc em hc sinh ng k du hc Thy S c tng:</span><br />\r\n<span> Ph visa du hc Thy S, v my bay du hc</span><br />\r\n<span> Min 100% ph dch v</span><br />\r\n<span> Hng dn chn trng hc ph hp vi kh nng ti chnh</span><br />\r\n<span> Hng dn luyn thi v h tr ph thi IELTS</span><br />\r\n<span> Hc bng n 2.000 CHF</span></p>\r\n', '', '', '', '', '', 1, 1, 1446521368, 1447641426, 0),
