(20, 0, 14, 0, 0, 'dichvu', 1, 0, 'phicongluan11449974222490x294-664.jpg', 'phicongluan11449974222490x294-664_200x160.jpg', 'Dch v chuyn tuyn quc t', '', 'dich-vu-chuyen-tuyen-quoc-te', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Bu chnh Viettel cam kt cung cp n Qu khch hng dch v chuyn tuyn quc t vi cht lng tt nht v gi c cnh tranh nht', '<p style="text-indent: 0.25in; text-align: justify;"><span style="font-size: 14px; font-family: times new roman;">Vi mng li kt ni trc tip n cc quc gia: CAMPUCHIA, TRUNG QUC, SINGAPORE, MALAYSIA, INDONESIA, THI LAN, PHILIPPIN, BRUNEY, NHT BN, HN QUC, I LOAN, HONGKONG, LO v MACAU.</span></p>\r\n\r\n<p style="text-indent: 0.25in; text-align: justify;"><span style="font-size: 14px; font-family: times new roman;">Bu chnh Viettel cam kt cung cp n Qu khch hng dch v chuyn tuyn quc t vi cht lng tt nht v gi c cnh tranh nht. S dng dch v ca chng ti, Qu khch hng c th yn tm v vic bu gi, hng ha ca Qu khch s c chng ti vn chuyn t Vit Nam n tn tay ngi nhn ti tt c cc tnh/thnh ph ca 12 quc gia v vng lnh th nu trn trong thi gian sm nht vi  an ton cao nht v mc chi ph ph hp nht.</span></p>\r\n\r\n<p style="text-indent: 0.25in; text-align: justify;"><span style="font-size: 14px; font-family: times new roman;">Mi thng tin xin vui lng lin h trc tip 63 chi nhnh bu chnh Viettel trn ton quc hoc lin h s in thoi: <strong>+84.4.6277.6811</strong>, hotline: <strong>19008095</strong> Email: <a href="mailto:HTQT@viettelpost.com.vn">HTQT@viettelpost.com.vn</a></span></p>\r\n', '', '', '', '', '', 1, 1, 1450063974, 1450065212, 0),
(21, 0, 14, 0, 0, 'dichvu', 1, 0, 'suarez257731449946303-1191.jpg', 'suarez257731449946303-1191_200x160.jpg', 'Dch v chuyn pht nhanh ', '', 'dich-vu-chuyen-phat-nhanh', '', '', '', '', '', '', '', '', '', 0, 0, 0, 0, 'Sau hn 17 nm trong lnh vc chuyn pht nhanh Viettel post c nh gi l mt doanh nghip ngy cng ln mnh v chuyn nghip, dch v chuyn pht nhanh ca Viettel post', '<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Hy nhc in thoi v gi cho Bu chnh Viettel khi bn c nhu cu gi th, qu, vn chuyn ha n, hng ha. Dch v ca Viettel post ng tin cy nh chnh bn t tay chuyn pht. Chng ti s gip cc bn chim c cm tnh ca bn b, ngi thn v cc i tc lm n.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Sau hn 17 nm trong lnh vc chuyn pht nhanh Viettel post c nh gi l mt doanh nghip ngy cng ln mnh v chuyn nghip, dch v chuyn pht nhanh ca Viettel post l dch v nhn gi, vn chuyn v pht cc loi chng t, hng ha theo cc ch tiu thi gian  cng b. Hng ha c vn chuyn bi Viettel Post c bo him 100% gi tr hng ha nu xy ra mt mt, h hng. Viettel Post cng cam kt v bo m an ton hng ha v thi gian chuyn pht.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Vi Viettel Post, dch v hon tr bo pht d dng, nhanh chng; thanh ton linh hot, tra cc online vi cc chnh sch gi, khuyn mi c bit hp dn. Quy trnh khai thc bu phm bu kin chuyn nghip, p dng cng vi cc cng ngh hin i vi mc ch phc v p ng tha mn khch hng tt nht: Cng ngh PDA c m vch t ng, cng ngh In E-bill t ng cn in t p dng xc nh khi trng lng bu phm, bu kin, cng ngh nh v GPS xc nh chnh xc ta , v tr bu phm, bu kin trn lch trnh chuyn pht.</span></span></p>\r\n\r\n<p style="text-align: justify;"><span class="NewsDetail_content" id="dnn_ctr2040_news_DichVu_Main_ctl00_lbContent"><span style="font-size: 14px; font-family: times new roman;">Viettel Post c h thng mng li bu cc 63 tnh thnh, tuyn huyn x, vng su, vng xa trn ton quc; phng tin vn ti hin i v dch v tra cu thng tin trc tip trn trang web www.viettelpost.com.vn v gi hng. Ty vo cc nhu cu cc bn c th chn mt trong cc gi dch v ca chng ti: Dch v 60h, dch v bu kin, dch v trong ngy, dch v 12h. Hoc gi trc tip cho chng ti  c t vn min ph qua hotline: <strong>19008095.</strong> Chng ti s gip cc bn la chn gi chuyn hp l v tit kim chi ph nht. </span></span></p>\r\n', '', '', '', '', '', 1, 1, 1450065247, 1450065254, 0),
