(1, 0, 'tintuc', 'polarloop-5198.jpg', 'polarloop-5198_295x195.jpg', 'Angela Phng Trinh khoe sc vi vy ha tit tri tim', 'angela-phuong-trinh-khoe-sac-voi-vay-hoa-tiet-trai-tim', 'Angela Phng Trinh khoe sc vi vy ha tit tri tim', 'Angela Phng Trinh khoe sc vi vy ha tit tri tim', 'Angela Phng Trinh khoe sc vi vy ha tit tri tim ', 'N din vin mc thit k ca  Mnh Cng trong b su tp Thu ng 2015 mang tn "Love" khi ti mt s kin.', '<div class="clear">&nbsp;</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Ln u hp tc, nh thit k  n tng vi dng v v thn thi ca Angela Phng Trinh khi mc trang phc ca anh.&nbsp;&lt;/p&gt;" data-reference-id="23045148" http:="" icons="" id="vne_slide_image_1" images="" js="" responsive="" slideshow="" src="http://c1.f12.img.vnecdn.net/2015/10/08/DSC-1038-2-1444323381_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Ln u hp t&aacute;c, nh&agrave; thit k &atilde; n tng vi d&aacute;ng v v&agrave; thn th&aacute;i ca Angela Phng Trinh khi mc trang phc ca anh.&nbsp;</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Kiu vy c cht liu vi bng, in ha tit tim , phom dng m c th.&lt;/p&gt;" data-reference-id="23045149" http:="" icons="" id="vne_slide_image_2" images="" js="" responsive="" slideshow="" src="http://c1.f12.img.vnecdn.net/2015/10/08/DSC-0818-2-1444323388_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Kiu v&aacute;y c&oacute; cht liu vi b&oacute;ng, in ha tit tim , phom d&aacute;ng &ocirc;m c th.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Ngi p sinh nm 1995 chn giy c mu sc hi ha vi ha tit vy.&lt;/p&gt;" data-reference-id="23045150" http:="" icons="" id="vne_slide_image_3" images="" js="" responsive="" slideshow="" src="http://c1.f10.img.vnecdn.net/2015/10/08/DSC-0822-2-1444323395_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Ngi p sinh nm 1995 chn gi&agrave;y c&oacute; m&agrave;u sc h&agrave;i h&ograve;a vi ha tit v&aacute;y.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	 Mnh Cng (phi) n d bui hp bo cng b phim  ng h vai din mi ca Phng Trinh.&lt;/p&gt;" data-reference-id="23045151" http:="" icons="" id="vne_slide_image_4" images="" js="" responsive="" slideshow="" src="http://c1.f10.img.vnecdn.net/2015/10/08/DSC-0923-2-1444323412_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p> Mnh Cng (phi) n d bui hp b&aacute;o c&ocirc;ng b phim  ng h vai din mi ca Phng Trinh.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 100%;">\r\n<div class="block_thumb_slide_show"><img a="" alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	NSND Hong Dng (tri) tham gia mt vai trong phim. y l d n phim chiu rp tip theo ca Angela Phng Trinh t sau tc phm " href="http://giaitri.vnexpress.net/tin-tuc/phim/sau-man-anh/angela-phuong-trinh-ngay-tho-trong-phim-biet-chet-lien-2453815.html" src="null" target="_blank" />Bit cht lin&quot; ca o din L&ecirc; Bo Trung nm 2013.\r\n<p>&nbsp;</p>\r\n&quot; data-reference-id=&quot;23045152&quot; http:=&quot;&quot; icons=&quot;&quot; id=&quot;vne_slide_image_5&quot; images=&quot;&quot; js=&quot;&quot; responsive=&quot;&quot; slideshow=&quot;&quot; src=&quot;http://c1.f9.img.vnecdn.net/2015/10/08/DSC-1143-2-1444323457_660x0.jpg&quot; st.f1.vnecdn.net=&quot;&quot; utils=&quot;&quot; /&gt; <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>NSND Ho&agrave;ng Dng (tr&aacute;i) tham gia mt vai trong phim. &acirc;y l&agrave; d &aacute;n phim chiu rp tip theo ca Angela Phng Trinh t sau t&aacute;c phm &quot;<a href="http://giaitri.vnexpress.net/tin-tuc/phim/sau-man-anh/angela-phuong-trinh-ngay-tho-trong-phim-biet-chet-lien-2453815.html" target="_blank">Bit cht lin</a>&quot; ca o din L&ecirc; Bo Trung nm 2013.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 100%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	 Mnh Cng bn ngi mu L Xun Tin (phi).&lt;/p&gt;" data-reference-id="23045153" http:="" icons="" id="vne_slide_image_6" images="" js="" responsive="" slideshow="" src="http://c1.f10.img.vnecdn.net/2015/10/08/DSC-0995-2-1444323469_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p> Mnh Cng b&ecirc;n ngi mu L&ecirc; Xu&acirc;n Tin (phi).</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 100%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Din vin Vit Anh bn din vin Trn Xun Tin. Vit Anh gi vai tr nh sn xut kim ng bin kch v o din trong d n phim.&lt;/p&gt;" data-reference-id="23045154" http:="" icons="" id="vne_slide_image_7" images="" js="" responsive="" slideshow="" src="http://c1.f9.img.vnecdn.net/2015/10/08/DSC-0863-2-1444323476_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Din vi&ecirc;n Vit Anh b&ecirc;n din vi&ecirc;n Trn Xu&acirc;n Tin. Vit Anh gi vai tr&ograve; nh&agrave; sn xut ki&ecirc;m ng bi&ecirc;n kch v&agrave; o din trong d &aacute;n phim.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Hoa hu i Dng ng Thu Tho tham gia mt vai trong phim.&lt;/p&gt;" data-reference-id="23045155" http:="" icons="" id="vne_slide_image_8" images="" js="" responsive="" slideshow="" src="http://c1.f9.img.vnecdn.net/2015/10/08/DSC-0706-2-1444323481_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Hoa hu i Dng ng Thu Tho tham gia mt vai trong phim.</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" css="" data-component-caption="&lt;p&gt;\r\n	Hoa khi Nguyn Th L Nam Em tham d s kin vi b vy m gi cm. nh: &lt;em&gt;Maison De Bil&lt;/em&gt;&lt;/p&gt;" data-reference-id="23045156" http:="" icons="" id="vne_slide_image_9" images="" js="" responsive="" slideshow="" src="http://c1.f12.img.vnecdn.net/2015/10/09/IMG-3550-1444325181_660x0.jpg" st.f1.vnecdn.net="" utils="" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Hoa kh&ocirc;i Nguyn Th L Nam Em tham d s kin vi b v&aacute;y &ocirc;m gi cm. nh: <em>Maison De Bil</em></p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n', '', '', '', 1, 1, 1444356666, 1444875020, 0),
(2, 0, 'dichvu', '-8402.jpg', '-8402_295x195.jpg', 'Dch v lm p', 'dich-vu-lam-dep', 'Angela Phng Trinh khi mc trang phc ca anh', 'Angela Phng Trinh khi mc trang phc ca anh', 'Ln u hp tc, nh thit k  n tng vi dng v v thn thi ca Angela Phng Trinh khi mc trang phc ca anh. ', 'Ln u hp tc, nh thit k  n tng vi dng v v thn thi ca Angela Phng Trinh khi mc trang phc ca anh. ', '<div class="clear">&nbsp;</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" data-component-caption="&amp;lt;p&amp;gt;\r\n	Ln u hp tc, nh thit k  n tng vi dng v v thn thi ca Angela Phng Trinh khi mc trang phc ca anh.&nbsp;&amp;lt;/p&amp;gt;" data-reference-id="23045148" id="vne_slide_image_1" src="http://c1.f12.img.vnecdn.net/2015/10/08/DSC-1038-2-1444323381_660x0.jpg" style="cursor: url(&quot;http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png&quot;), auto;" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Ln u hp t&aacute;c, nh&agrave; thit k &atilde; n tng vi d&aacute;ng v v&agrave; thn th&aacute;i ca Angela Phng Trinh khi mc trang phc ca anh.&nbsp;</p>\r\n</div>\r\n\r\n<div class="clear">&nbsp;</div>\r\n</div>\r\n\r\n<div class="item_slide_show" style="width: 75.7576%;">\r\n<div class="block_thumb_slide_show"><img alt="" class="left" data-component-caption="&amp;lt;p&amp;gt;\r\n	Kiu vy c cht liu vi bng, in ha tit tim , phom dng m c th.&amp;lt;/p&amp;gt;" data-reference-id="23045149" id="vne_slide_image_2" src="http://c1.f12.img.vnecdn.net/2015/10/08/DSC-0818-2-1444323388_660x0.jpg" style="cursor: url(&quot;http://st.f1.vnecdn.net/responsive/js/utils/slideshow/css/slideshow/images/icons/zoom_cursor.png&quot;), auto;" /> <a class="btn_icon_show_slide_show">&nbsp;</a></div>\r\n\r\n<div class="desc_cation">\r\n<p>Kiu v&aacute;y c&oacute; cht liu vi b&oacute;ng, in ha tit tim , phom d&aacute;ng &ocirc;m c th.</p>\r\n</div>\r\n\r\n<div