(211, 50, 16, 49, 0, '', 0, 0, '', '', 'product', 1, 0, 'thot-kova-sizem-36x23cm-702.jpg', 'thot-kova-sizem-36x23cm-702_195x195.jpg', 'Tht nha khng khun Kova np 4 gc', 'TKSM', 'thot-nhua-khang-khuan-kova-nep-4-goc', '', '', '', 'Korea', 0, 600, '', '', 'Tht nha khng khun Kova', 'tht nha, tht khng khun, tht g, tht vung, tht trn, tht nhp khu', 'tht nha, tht khng khun, tht g, tht vung, tht trn, tht nhp khu', 0, 0, 139000, 0, '- SP khng p dng trong chng trnh gim gi 10%\r\nTht Nha Kova TKSM c sn xut ti Hn Quc theo cng ngh tin tin. Tht s dng c c hai mt, bn c th dng mt mt  thi  sng v mt kia thi  chn rt tin li. c bit tht khc phc hu ht nhng khuyt im ca tht g, tht nha c gc KOVA  v ang chinh phc hu ht nhng b ni tr kh tnh. Tht chc chn, khng khun,  bn cao v thit k p mt l sn phm khng th thiu trong gian bp nh bn.', '<div class="product-content-detail" style="box-sizing: border-box; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;">\r\n<div class="content js-content expand" id="gioi-thieu" itemprop="description" style="box-sizing: border-box; overflow: hidden; margin-bottom: 15px; max-height: none;">\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; text-decoration: underline; color: rgb(0, 128, 0);"><span style="box-sizing: border-box; font-weight: 700;">Tnh nng sn phm:</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- Nha PP khng khun</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;">Tht Kova TKSS-GR lm t nha P.P c  bn cao, l loi nha an ton, khng gy hi cho sc khe ngi dng. Tht cn c kh nng khng khun, nn bn c th yn tm ct thc n chn.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- Rnh thot nc</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box;">Rnh thot ncchng m mc, khng khun tt, d v sinh.Nn s dng 1 tht cho thc phm chn v 1 tht cho thc phm sng.</span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: justify;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- Tnh tin li cao</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Tht Nha Kova TKSM s dng c c hai mt, c th s dng  thi, bm, cht... rt tin li.</p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;"><span style="box-sizing: border-box; color: rgb(128, 0, 128);"><span style="box-sizing: border-box; font-weight: 700;">- V sinh tht</span></span></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px;">Sau khi ct thc n, tht ra khng sch s pht sinh nhiu vi khun. Do  bn nh ra sch bng nc ra chn ngay sau khi s dng ri dng hoc treo tht ln cho ro nc.  tng kh nng chng vi khun, bn hy rc mt t mui ln b mt tht, sau  dng na tri chanh ch ln tht hoc bn  nc nng ln tht, ri dng bn chi cng  ch ra.</p>\r\n\r\n<p><img alt="mych.vn tht nha khng khun kova np 4 gc" height="400" src="http://mych.vn/vubaohuy/upload/images/NHUA%2C%20MELAMINE/Th%E1%BB%9Bt%20KOVA%20sizeM%2036x23cm.jpg" style="box-sizing:border-box; vertical-align:middle; border:0px; display:block; max-width:100%; height:auto; margin-left:auto; margin-right:auto; float:left" width="400" /></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: center;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: center;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: center;"></p>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; text-align: center;"></p>\r