i>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Phn b nhit u, gip nh nhng sy kh tc.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">S dng an ton vi chc nng t ngt khi my hot ng qu ti.</span></li>\r\n</ul>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Thng s k thut</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Hiu in th: 230V/50Hz</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Cng sut: 1000W</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Cn bng nhit: C</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">a cp  nhit: C</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Gim  n: C</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">T ngt in khi qu nhit: C</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Khi lng sn phm: 0.32kg</span></li>\r\n</ul>\r\n\r\n<p style="box-sizing: border-box;"><img alt="mych.vn my sy tc BlueStone HDB1821B" height="400" src="http://mych.vn/vubaohuy/upload/images/MAY%20SAY%20TOC%2C%20BAN%20UI/BlueStone%20HDB1821B%20250k-188.jpg" width="400" /></p>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Hng dn s dng an ton</span></h3>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Nn lau kh tay trc khi s dng my.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Khng t my sy ln trn gi hoc mn khi ang s dng, khng ph khn, o,vo np thng gi khi my ang hot ng, m bo lung gi c lu thng tt khi my sy hot ng.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Lun rt phch cm ra khi ngun in sau khi s dng xong.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Khng s dng my sy tc  nhng ni c kh gas hay vt liu gy chy khc (nh benzen, cht pha long sn, cc loi bnh phun kh,)</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Khng dng vt liu th cng  lau chi sn phm. Nn dng vi mng, mm v m  lau sau  lau li bng vi kh.</span></li>\r\n</ul>\r\n\r\n<h3 style="box-sizing: border-box; clear: both; font-family: Arial, Roboto, Georgia, serif; color: rgb(211, 18, 66); line-height: 1.3; font-size: 22px; margin: 22px 0px;"><span style="color:#0000CD;">Khuyn bn nn v sinh my sy tc:</span></h3>\r\n\r\n<p style="box-sizing: border-box; margin: 0px 0px 24px; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;"><span style="font-size:16px;">Sau mt thi gian s dng, my sy tc thng hay b bm bi nghim trng  b phn thi v np kh, v thng lm gim hiu sut lm kh tc hay lm h tn tc. Chng ti khuyn bn mt s iu sau  my sy s dng bn v hiu qu hn:</span></p>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Nn v sinh my sy tc mi thng mt hoc nhiu ln hn, nu c th.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;"> lm sch b phn thi kh, gm in, bn nn bt cng tc sang ch  sy thp nht, s dng bn chi mm  mc bi ra trong khi my vn ang thi kh mt ra ngoi.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Vi b phn np kh, bn nn tt my v v tr 0, sau  s dng bn chi mm hoc my ht bi mini  ly bi ra.</span></li>\r\n</ul>\r\n\r\n<p><span style="font-size:16px;">My c thit k gn nh vi kiu dng trang nh, mu trng tinh t, ph hp vi nhiu la tui. Tay cm nh nhn, d dng khi s dng. Vi thit k nh xinh, bn c th d dng em my theo bn ngi ngay c khi i du lch hay i cng tc. Mc treo tng rt tin li khi bn mun lu gi, bo qun my sau khi s dng xong.</span></p>\r\n\r\n<ul style="box-sizing: border-box; margin: 16px 0px; padding-right: 0px; list-style-type: square; color: rgb(87, 87, 87); font-family: Arial, \'Open Sans\', Helvetica, sans-serif; font-size: 14px; line-height: 25.2px;">\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">V ngoi c lm bng cht liu nha cng cao cp, khng b v khi va p nh, gip bn s dng an ton v lu bn hn. Cht liu nha c sn sng bng, khng bm bi, rt d dng khi bn mun lau chi, v sinh my,  my lun trng sch p nh khi mi mua.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Vi 2 mc iu chnh nhit , bn c th ty chn nhit  sy ph hp vi nhiu loi tc v nhu cu sy khc nhau.<br style="box-sizing: border-box;" />\r\n	Chc nng cn bng nhit gip my gi nhit n nh  mc 57  C gip lun gi c  m vn c ca tc. Thit k phn b nhit u gip tc c sy kh nh nhng, mt m, khng cn phi di chuyn qu nhiu ln.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">c bit, my sy tc HDB 1821B cn c trang b chc nng t bo v thng minh: my t ngt in khi nhit  qu cao, my qu nng, mch in trong nh qu ti, m bo an ton tuyt i cho gia nh bn, gip tit kim in nng v ko di tui th s dng my.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Cng sut my 1000W, gip bn sy kh tc nhanh m khng lm h tc, em li mi tc khe p t nhin cho ngi dng.</span></li>\r\n	<li style="box-sizing: border-box;"><span style="font-size:16px;">Ngoi chc nng sy tc, my sy Bluestone cn c th gip bn thi bay nhng ht bi li ti dnh trn bn phm my tnh, hay c th sy kh mt s qun o nh, khn mng hay tt<br style="box-sizing: border-box;" />\r\n	c p dng cng ngh hin i ca Hoa K, s dng motor cht lng tt, my vn hnh m i. Thit k np thng gi vi cu trc dng t ong, cng cnh qut c  nghing 320 lm gim ting n ti a khi s dng, em li cm gic thoi mi cho ngi dng.</span></li>\r\n</ul>\r\n\r\n<p></p>\r\n', '', '', '', '', '', '', 1, 1, 1457824941, 1464321277, 0);
